//Home page Component

//Module import
import React, { Component } from 'react';

//Style import
import './Home.css';

class Home extends Component {
	constructor(props) {
		super(props);

		this.state = {};
	}
	render() {
		return (
			<div>
				<div className="carousel carousel-slider">
					<a className="carousel-item" href="#one!">
						<img
							src="../../../public/img/pizza1.jpg"
							alt="my-photo"
						/>
					</a>
					<a className="carousel-item" href="#two!">
						<img
							src="../../../public/img/pizza2.jpg"
							alt="my-photo"
						/>
					</a>
					<a className="carousel-item" href="#three!">
						<img
							src="../../../public/img/pizza3.jpg"
							alt="my-photo"
						/>
					</a>
					<a className="carousel-item" href="#four!">
						<img
							src="../../../public/img/pizza4.jpg"
							alt="my-photo"
						/>
					</a>
					<a className="carousel-item" href="#five!">
						<img
							src="../../../public/img/pizza5.jpg"
							alt="my-photo"
						/>
					</a>
				</div>
			</div>
		);
	}
}

export default Home;
